import React, { Component } from 'react'
import CompanyService from '../services/CompanyService'
import UserService from "../services/user.service";
import EventBus from "../common/EventBus";

class ListCoupon extends Component {
    constructor(props) {
        super(props)

        this.state = {
                company: []
        }
        this.addCoupon= this.addCoupon.bind(this);
        this.editCoupon = this.editCoupon.bind(this);
        this.deleteCoupon = this.deleteCoupon.bind(this);
    }
    
  componentDidMount() {
    UserService.getModeratorBoard().then(
      response => {
        this.setState({
          company: response.data
        });
      },
      error => {
        this.setState({
          company:
            (error.response &&
              error.response.data &&
              error.response.data.message) ||
            error.message ||
            error.toString()
        });

        if (error.response && error.response.status === 401) {
          EventBus.dispatch("logout");
        }
      }
    );
  }


    deleteCoupon(company_id){
        CompanyService.deleteProductsById(company_id).then( res => {
            this.setState({company: this.state.company.filter(company => company.company_id!==company_id)});
            console.log(res.data);
        });
    }
    viewEmployee(company_id){
        this.props.history.push(`/view-company/${company_id}`);
    }
    editCoupon(company_id){
        this.props.history.push(`/add-company/${company_id}`);
    }

    componentDidMount(){
        CompanyService.gettotalcoupons.then((res) => {
            this.setState({ company: res.data});
        });
    }

    addCoupon(){
        this.props.history.push('/add-coupon/_add');
    }

    render() {
        return (
            <div>
                 <h2 className="text-center">Employees List</h2>
                 <div className = "row">
                    <button className="btn btn-primary" onClick={this.addEmployee}> Add Employee</button>
                 </div>
                 <br></br>
                 <div className = "row">
                        <table className = "table table-striped table-bordered">

                            <thead>
                                <tr>
                                    <th>COMPANY NAME</th>
                                    <th>LOCATION</th>
                                    <th>PRODUCT Category</th>
                                    <th>COUPON ID</th>
                                    <th>COUPON CODE</th>
                                    <th>COUPON SET NAME</th>
                                    <th>DISCOUNT AMOUNT</th>
                                    <th>PRODUCT ID</th>
                                    <th>PRODUCT NAME</th>
                                    <th>PRICE</th>
                                    <th> Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    this.state.company.map(
                                        company=> 
                                        <tr key = {company.company_id}>
                                             <td> { company.comName} </td>   
                                             <td> {company.location}</td>
                                             <td> {company.product_category}</td>
                                             <td> {company.coupon_id}</td>
                                             <td> {company.coupon_code}</td>
                                             <td> {company.coupon_set_name}</td>
                                             <td> {company.discouny_amount}</td>
                                             <td> {company.product_id}</td>
                                             <td> {company.product_name}</td>
                                             <td> {company.price}</td>
                                             <td>
                                                 <button onClick={ () => this.editCoupon(company.company_id)} className="btn btn-info">Update </button>
                                                 <button style={{marginLeft: "10px"}} onClick={ () => this.deleteCoupon(company.company_id)} className="btn btn-danger">Delete </button>
                                                 <button style={{marginLeft: "10px"}} onClick={ () => this.viewCoupon(company.company_id)} className="btn btn-info">View </button>
                                             </td>
                                        </tr>
                                    )
                                }
                            </tbody>
                        </table>

                 </div>

            </div>
        )
    }
}

export default ListCoupon
